import React from "react";
import Navbar from "../navbar/Navbar";
import NavbarJury from "../navbar/NavbarJury";

function IsUser(props){
    const ROLES = {
        'Jury': false,
        'Admin': true
      }
    if (ROLES.Admin && ROLES != null || ROLES.Jury && ROLES != null) {
      return (
        <>
            { ROLES.Admin ? (
              <NavbarJury/>
            ) : (
              <Navbar/>
            )
            }
          </>
      )
    } else {
      return null
    } 
}

export default IsUser;
